import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const NetFlixx = () => {
  return (
    <>
      <Card
        key={Sdata[2].id}
        imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        links={Sdata[2].links}
      />
    </>
  );
};

export default NetFlixx;
